import React from 'react';

type CardProps = {
contact: {
name: string;
picture: string;
};
onTouch: () => void;
};

const Card = ({ contact, onTouch }: CardProps) => {
return (
<div style={{ display: 'flex', alignItems: 'center' }} onTouchStart={onTouch}>
<img src={contact.picture} alt={contact.name} />
<div style={{ marginLeft: '1rem' }}>{contact.name}</div>
<div style={{ marginLeft: 'auto' }}>
<i className="material-icons">bookmark_border</i>
</div>
</div>
);
};

export default Card;
